import { SeatsioClient, Region } from 'seatsio'

let client = new SeatsioClient(Region.EU(), '3906cc97-c0c1-4d76-a156-a6ba69acbc03')
let cat1 = {'key': 1, 'label': 'Category 1', 'color': '#aaaaaa'};
let cat2 = {'key': 2, 'label': 'Category 2', 'color': '#bbbbbb'};
let chart = await client.charts.create('my chart', 'ROWS_WITH_SECTIONS', [cat1, cat2])
let event = await client.events.create(chart.key)
